import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import CarServices from "../../services/CarService";
import ClientServices from "../../services/ClientService";

export default function AddCar() {
    const [clientId, setClientId] = useState('');  // Selected user ID for the car
    const [marque, setMarque] = useState('');
    const [model, setModel] = useState('');
    const [matricule, setMatricule] = useState('');
    const [car, setCar] = useState({
        marque: "",
        model: "",
        matricule: ""
    });
    const [clients, setClients] = useState([]);  // State to store list of clients (users)
    const [selectedClientId, setSelectedClientId] = useState('');  // State to store the selected client ID
    const navigate = useNavigate();

    // Fetch the clients list when the component mounts
    useEffect(() => {
        ClientServices.findALL()  // Using your ClientServices to fetch all clients
            .then((response) => {
                setClients(response.data);  // Assuming response.data contains the list of clients
            })
            .catch((error) => {
                console.error("Error fetching clients:", error);
                toast.error("Erreur lors de la récupération des clients.", {
                    position: "top-right",
                    autoClose: 3000,
                    hideProgressBar: false,
                    closeOnClick: true,
                    pauseOnHover: true,
                    draggable: true,
                });
            });
    }, []);

    const handleSave = (e) => {
        e.preventDefault();

        // Add selectedClientId to car object if needed
        const updatedCar = { ...car, clientId: selectedClientId };

        CarServices.saveVoiture(updatedCar, selectedClientId)
            .then(() => {
                navigate('/');
                toast.success('Voiture ajoutée avec succès!', {
                    position: "top-right",
                    autoClose: 3000,
                    hideProgressBar: false,
                    closeOnClick: true,
                    pauseOnHover: true,
                    draggable: true,
                });
            })
            .catch(error => {
                console.error("Erreur d'enregistrement :", error);
                toast.error("Erreur lors de l'enregistrement ...!!", {
                    position: "top-right",
                    autoClose: 3000,
                    hideProgressBar: false,
                    closeOnClick: true,
                    pauseOnHover: true,
                    draggable: true,
                });
            });
    };

    return (
        <div>
            <h3>Ajout d'une nouvelle voiture</h3>
            <form onSubmit={handleSave}>
                <div className="form-group">
                    <label>Marque</label>
                    <input
                        type="text"
                        value={car.marque}
                        className="form-control"
                        onChange={(e) => setMarque(e.target.value)}
                        required
                    />
                </div>

                <div className="form-group">
                    <label>Modèle</label>
                    <input
                        type="text"
                        value={car.model}
                        className="form-control"
                        onChange={(e) => setModel(e.target.value)}
                        required
                    />
                </div>

                <div className="form-group">
                    <label>Matricule</label>
                    <input
                        type="text"
                        value={car.matricule}
                        className="form-control"
                        onChange={(e) => setMatricule(e.target.value)}
                        required
                    />
                </div>

                {/* Dropdown for selecting client */}
                <div className="form-group">
                    <label>Client</label>
                    <select
                        value={selectedClientId}
                        onChange={(e) => setSelectedClientId(e.target.value)}
                        className="form-control"
                        required
                    >
                        <option value="">Sélectionner un client</option>
                        {clients.map((client) => (
                            <option key={client.id} value={client.id}>
                                {client.name}  {/* Assuming 'name' is the field for the client */}
                            </option>
                        ))}
                    </select>
                </div>

                <button type="submit" className="btn btn-primary">Ajouter la voiture</button>
            </form>
            <ToastContainer />
        </div>
    );
}
